import React from 'react';
import "./Home.scss";
import Navbar from '../../narbar/Navbar';
import Featured from '../../featured/Featured';
import List from '../../list/List';
import { useState } from 'react';

function Home({type}) {

  const [lists, setLists] = useState([]);
  return (
    <div className='home'>  
        
        <Navbar/>
        <Featured type={type}/>
        <List/>
        <List/>
        <List/>
        <List/>
    </div>
  )
}

export default Home
